import React from "react";
import { useNavigate } from "react-router-dom";
import { Menu, Dropdown, Button } from "antd";
import "./index.scss";

const HeaderPage = () => {
  const navigate = useNavigate();

  const menuItems = [
    {
      label: "Trang chủ",
      key: "main",
    },
    {
      label: "Tra cứu học phần",
      key: "termSearch",
    },
    {
      label: "Thời khóa biểu",
      key: "schedule",
    },
  ];
  const personalInforItems = [
    {
      label: "Đăng xuất",
      key: "logout",
    },
  ];
  return (
    <>
      <Menu mode="horizontal" items={menuItems} className="header-menu" />
      <Dropdown menu={{ personalInforItems }} placement="bottomLeft">
        <Button>12345678|Nguyen Van A</Button>
      </Dropdown>
    </>
  );
};
export default HeaderPage;
